{
  "properties": {
    "template": {
      "$schema": "https://schema.management.azure.com/schemas/2015-01-01/deploymentTemplate.json#",
      "contentVersion": "1.0.0.0",
      "parameters": {
        "adminUsername": {
          "type": "string",
          "metadata": {
            "description": "Admin username for VM"
          }
        },
        "adminPassword": {
          "type": "securestring",
          "metadata": {
            "description": "Admin password for VM"
          }
        },
        "newStorageAccountName": {
          "type": "string",
          "metadata": {
            "description": "Unique storage account name"
          }
        },
        "numberOfInstances": {
          "type": "int",
          "defaultValue": 2,
          "metadata": {
            "description": "Number of VMs to deploy"
          }
        },
        "location": {
          "type": "string",
          "metadata": {
            "description": "Location to deploy the VM in"
          }
        },
        "vmSize": {
          "type": "string",
          "metadata": {
            "description": "Size of the Virtual Machine."
          }
        },
        "imagePublisher": {
          "type": "string",
          "defaultValue": "Canonical",
          "metadata": {
            "description": "Image Publisher"
          }
        },
        "imageOffer": {
          "type": "string",
          "defaultValue": "UbuntuServer",
          "metadata": {
            "description": "Image Offer"
          }
        },
        "imageSKU": {
          "type": "string",
          "defaultValue": "14.04.2-LTS",
          "metadata": {
            "description": "Image SKU"
          }
        }
      },
      "variables": {
        "virtualNetworkName": "myVNET",
        "vnetID": "[resourceId('Microsoft.Network/virtualNetworks', variables('virtualNetworkName'))]",
        "addressPrefix": "10.0.0.0/16",
        "subnet1Name": "Subnet-1",
        "subnet1Prefix": "10.0.0.0/24",
        "subnet1Ref": "[concat(variables('vnetID'),'/subnets/', variables('subnet1Name'))]",
        "vmStorageAccountContainerName": "vhds"
      },
      "resources": [
        {
          "type": "Microsoft.Storage/storageAccounts",
          "name": "[parameters('newStorageAccountName')]",
          "apiVersion": "2015-05-01-preview",
          "location": "[parameters('location')]",
          "properties": {
            "accountType": "Standard_LRS"
          }
        },
        {
          "apiVersion": "2015-05-01-preview",
          "type": "Microsoft.Network/virtualNetworks",
          "name": "[variables('virtualNetworkName')]",
          "location": "[parameters('location')]",
          "properties": {
            "addressSpace": {
              "addressPrefixes": [
                "[variables('addressPrefix')]"
              ]
            },
            "subnets": [
              {
                "name": "[variables('subnet1Name')]",
                "properties": {
                  "addressPrefix": "[variables('subnet1Prefix')]"
                }
              }
            ]
          }
        },
        {
          "apiVersion": "2015-05-01-preview",
          "type": "Microsoft.Network/publicIPAddresses",
          "name": "[concat('publicIP', copyIndex())]",
          "location": "[parameters('location')]",
          "copy": {
            "name": "publicIPLoop",
            "count": "[parameters('numberOfInstances')]"
          },
          "properties": {
            "publicIPAllocationMethod": "Dynamic"
          }
        },
        {
          "apiVersion": "2015-05-01-preview",
          "type": "Microsoft.Network/networkInterfaces",
          "name": "[concat('nic', copyindex())]",
          "location": "[parameters('location')]",
          "copy": {
            "name": "nicLoop",
            "count": "[parameters('numberOfInstances')]"
          },
          "dependsOn": [
            "[concat('Microsoft.Network/virtualNetworks/', variables('virtualNetworkName'))]",
            "[concat('Microsoft.Network/publicIPAddresses/', 'publicIP', copyindex())]"
          ],
          "properties": {
            "ipConfigurations": [
              {
                "name": "ipconfig1",
                "properties": {
                  "privateIPAllocationMethod": "Dynamic",
                  "publicIPAddress": {
                    "id": "[resourceId('Microsoft.Network/publicIPAddresses',concat('publicIP', copyindex()))]"
                  },
                  "subnet": {
                    "id": "[variables('subnet1Ref')]"
                  }
                }
              }
            ]
          }
        },
        {
          "apiVersion": "2015-05-01-preview",
          "type": "Microsoft.Compute/virtualMachines",
          "name": "[concat('myvm', copyIndex())]",
          "location": "[parameters('location')]",
          "copy": {
            "name": "virtualMachineLoop",
            "count": "[parameters('numberOfInstances')]"
          },
          "dependsOn": [
            "[concat('Microsoft.Network/networkInterfaces/', 'nic', copyindex())]",
            "[concat('Microsoft.Storage/storageAccounts/', parameters('newStorageAccountName'))]"
          ],
          "properties": {
            "hardwareProfile": {
              "vmSize": "[parameters('vmSize')]"
            },
            "osProfile": {
              "computername": "[concat('vm', copyIndex())]",
              "adminUsername": "[parameters('adminUsername')]",
              "adminPassword": "[parameters('adminPassword')]"
            },
            "storageProfile": {
              "imageReference": {
                "publisher": "[parameters('imagePublisher')]",
                "offer": "[parameters('imageOffer')]",
                "sku": "[parameters('imageSKU')]",
                "version": "latest"
              },
              "osDisk": {
                "name": "osdisk",
                "vhd": {
                  "uri": "[concat('http://',parameters('newStorageAccountName'),'.blob.core.windows.net/vhds/','osdisk', copyIndex(), '.vhd')]"
                },
                "caching": "ReadWrite",
                "createOption": "FromImage"
              }
            },
            "networkProfile": {
              "networkInterfaces": [
                {
                  "id": "[resourceId('Microsoft.Network/networkInterfaces',concat('nic', copyindex()))]"
                }
              ]
            }
          }
        }
      ]
    },
    "parameters": {
      "newStorageAccountName": {
        "value": "crptestps322sto"
      },
      "adminUsername": {
        "value": "Foo12"
      },
      "adminPassword": {
        "value": "BaR@123crptestps322"
      },
      "numberOfInstances": {
        "value": 51
      },
      "location": {
        "value": "westus"
      },
      "vmSize": {
        "value": "Standard_A0"
      }
    },
    "mode": "Incremental"
  }
}

